window.bookSummaryJSON = "<p>I’m locked in a war that’s not of my making, and I’m tied to a destiny I have no say in. For someone like me, Brennan O’Donnelly represents something intangible - safety. A single promise unlocks options I didn’t dare dream of possessing...</p> <p>A future. A family. </p> <p>He’s hard. He’s dangerous. He’s filthy. Yet, somehow, he’s exactly what I crave.</p> <p>Now I just need to make him see me for what I am - his queen. If he’ll have me...this is Brennan O'Donnelly's story.</p> <p><b>Warning: This audiobook contains scenes of graphic violence that some readers might find disturbing.</b></p>"; 
